def to_js(s: str) -> str:
    res = ""
    for c in s:
        res += _unescape
        res += "("+guillemet
        res += pourcent
        a = hex(ord(c))[2:]
        if len(a) == 1:
            a = "0" + a
        print(f"{c}:{a}")
        for i in a:
            res += dictionary[i]
        res += guillemet + ")+"
    return res[:-1]


